import React from 'react';

function Scorebar(props) {
    
        return (
        <div>
            <div className="row bg-gray">
                <div className="col">HighScore = {props.highScore}</div>
                <div className="col-md-auto">clicked Message = {props.clickedMessage}</div>
                <div className="col align-self-end">click Guess = {props.correctGuess}</div>
            </div>
        </div>
  );
}



export default Scorebar;
